import axios from "axios";

function AccountTestApi() {
  const accId = 1;

  axios
    .get("http://localhost:8080/api/account/" + accId)
    .then((res) =>
      console.log(res.data.accId).catch((err) => console.log(err))
    );
}

export default AccountTestApi;
